import React from "react";
import characters from "../json/Characters.json"

const CharactersPage = () => {
    return (
        <table>
            <thead>
                <tr>
                    <th>Character</th>
                    <th>HP</th>
                    <th>STR</th>
                    <th>MAG</th>
                    <th>DEX</th>
                    <th>SPD</th>
                    <th>DEF</th>
                    <th>RES</th>
                    <th>LCK</th>
                    <th>BLD</th>
                </tr>
            </thead>
            <tbody>
                {characters.map((character, index) => {
                    return (
                        <tr>
                            <th>{character.name}</th>
                            <td>{character.hp}</td>
                        </tr>
                    )
                })}
            </tbody>
        </table>
    )
}

export default CharactersPage
